import React,{Component} from 'react';

class ClassComponent extends Component{
    render(){
        return(
            <div className="container">
                <div className="row">
                    <div className="col-md-12 jumbotron text-center">
                        <h2>Welcome to ClassComponent</h2>
                    </div>
                </div>

            </div>
        );
    }
}

export default ClassComponent;
